import Vue from 'vue';
import Router from 'vue-router';

import Home from '@/components/Home.vue';
import Login from '@/components/Login.vue';

Vue.use(Router)

const router = new Router({

    routes:[
        {path:"/",redirect:"/login"},
        {path:"/home",component:Home},
        {path:"/login",component:Login},
    ],
})


export default router
